import "./Header.css";
import React, { useState } from "react";
import { Typography, Button, Divider, Box, Grid, Tabs, Tab } from "@mui/material";
import logo from "../asset/logo.png";
import { Navigate } from "react-router-dom";

function Header() {
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
      Navigate("/login");
    };
  return (
    <>
      <div id="header">
        <Box
          sx={{
            display: "grid",
            alignItems: "center",
            width: "100%",
            borderRadius: 1,
            color: "text.secondary",
            "& svg": {
              m: 1.5,
            },
            "& hr": {
              mx: 0.5,
            },
          }}
        >
          <Grid container spacing={10}>
            <Grid item xs={1}>
              <Typography align="left">
                <a href="/">
                  <img
                    href="/"
                    src={logo}
                    style={{ marginTop: "0%", height: "40px" }}
                  ></img>
                </a>
              </Typography>
            </Grid>
            <Grid item xs={1}>

            </Grid>
            <Grid item xs={7}>
            <Tabs value={value} onChange={handleChange} aria-label="Main Tabs">
                <Tab label="HOME">
                <Button>
                HOME
                </Button>
                </Tab>
                <Tab label="CREATE">
                <a href="/login">로그인</a>
                <Button>
                Create
                </Button>
                </Tab>
                <Tab label="CHART">
                <Button>
                CHART
                </Button>
                </Tab>
                <Tab label="BOARD">
                <Button>
                BOARD
                </Button>
                </Tab>

            </Tabs>
            </Grid>

            <Grid item xs={1}>
            <Divider/>

            </Grid>

            <Grid item xs={2}>

              <Button align="right" marginRight={"3vw"}>
                <a href="/login">로그인</a>
              </Button>
            </Grid>
          </Grid>
        </Box>
      </div>
    </>
  );
}

export default Header;
